import React, { Component } from "react";
import { Map, HeatMap, GoogleApiWrapper } from "google-maps-react";
const { mapsKey } = require('../config.json');

// can change gradient to bubble tea oriented colors
// lower the amount of colors in gradient since we only have 50 places
const gradient = [
  "rgba(0, 255, 255, 0)",
  "rgba(0, 255, 255, 1)",
  "rgba(0, 191, 255, 1)",
  "rgba(0, 127, 255, 1)",
  "rgba(0, 63, 255, 1)",
  "rgba(0, 0, 255, 1)",
  "rgba(0, 0, 223, 1)",
  "rgba(0, 0, 191, 1)",
  "rgba(0, 0, 159, 1)",
  "rgba(0, 0, 127, 1)",
  "rgba(63, 0, 91, 1)",
  "rgba(127, 0, 63, 1)",
  "rgba(191, 0, 31, 1)",
  "rgba(255, 0, 0, 1)"
];

class Heatmap extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
        <div className="map-container">
            <Map
            google={this.props.google}
            className={"map"}
            zoom={this.props.zoom}
            initialCenter={this.props.center}
            onReady={this.handleMapReady}
            >
                <HeatMap
                    gradient={gradient}
                    positions={this.props.positions}
                    opacity={1}
                    radius={20}
                />
            </Map>
        </div>
        );
    }
}

export default GoogleApiWrapper({
  apiKey: mapsKey,
  libraries: ["visualization"]
})(Heatmap);
